import React from 'react';
import './PlayArea.sass'

function PlayArea(props) {

    function renderCells() {
        let cells = []
        for (let i = 0; i < 25; i++) {
            cells.push(
                <div className='PlayArea__cell' key>{props.gameData[i]}</div>
            )
        }
        return cells
    }

    return(
        <div className="PlayArea">
            {renderCells()}
        </div>
        )
}

export default PlayArea;
